import React from "react";
import Tooltip from 'rc-tooltip';

const ToolTip = (props) => {
    return (
        <div>
            <Tooltip placement="right" trigger={['click']} overlay={<span>tooltip</span>}>
                {props.word} is used {props.frequency}times
            </Tooltip>
        </div>
    )
}

export default ToolTip;
